import React from "react";
import 'bootstrap/dist/css/bootstrap.min.css';
import 'bootstrap-icons/font/bootstrap-icons.css';
import './App.css';

class App extends React.Component {

  constructor(props) {
      super(props);
  }

  handleClick(event) {
      event.preventDefault();

  }

  fetchWordLesson(word) {
      fetch("https://api.dictionaryapi.dev/api/v2/entries/en/" + word)
          .then(response => response.json())
          .then(data => {
              console.log(data);
          })
  }

  render() {
      return (
      <div>
        <h1 id="titleLabel">WordFort</h1>
        <form id="wordSearcher" onSubmit="defineWord">
            <input className="form-control form-control-lg" placeholder="Enter word"/>
            <button className="btn btn-primary" onClick={this.handleClick}><i className="bi bi-search" /></button>
        </form>
      </div>
    );
  }
}

export default App;
